Hi all - New to this channel. I am trying to use the API for searching Contacts with a first name or last name containing part of the names. It looks like *CONTAINS_TOKEN* expects the full word and not part of it. Is there any other alternative to accomplish what I am trying to do. I also tried using query="abc", but that seems to return results from unused properties or properties that were updated later on, thereby not giving current and useful result.

Any help is much appreciated.
{
    "filterGroups":[
        {
            "filters": [
                {
                    "propertyName": "firstname",
                    "operator": "CONTAINS_TOKEN",
                    "value": "kuma"
                }
            ]
        },
        {
            "filters": [
                {
                    "propertyName": "lastname",
                    "operator": "CONTAINS_TOKEN",
                    "value": "clint"
                }
            ]
        }
    ]
}
